import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Route, Switch} from 'react-router';
import {BrowserRouter} from 'react-router-dom';
import {composeWithDevTools} from "redux-devtools-extension";
import { createStore, applyMiddleware } from 'redux';
import thunk from 'redux-thunk';
import rootReducer from './reducers/rootReducer';
import {Provider} from 'react-redux';
import { LandingPageLayout } from './components/landingPage/layout';
import TextField from '@material-ui/core/TextField';
import { fade, withStyles, makeStyles, createMuiTheme } from '@material-ui/core/styles';



const CssTextField = withStyles({
  root: {
    '& label': {
      color: 'green',
    },
    '& label.Mui-focused': {
      color: 'green',
    },
    '& input': {
      color: 'green',
    },

    '& label.Mui': {
      color: 'green',
    },

    '& .MuiInput-underline:before': {
      borderBottomColor: 'green',
    },
    '& .MuiInput-underline:after': {
      borderBottomColor: 'green',
    },

    '& .MuiOutlinedInput-root': {
      '& fieldset': {
        borderColor: 'red',
      },
      '&:hover fieldset': {
        borderColor: 'yellow',
      },
      '&.Mui-focused fieldset': {
        borderColor: 'green',
      },
    },
  },
})(TextField);

const useStyles = makeStyles(theme => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing(1),
  },
}));

function App() {
  const classes = useStyles();

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p className='inputs'>
          Welcome to the Science Spelling Training.
          <CssTextField id="custom-css-standard-input" fullWidth label="Custom CSS" />
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

const store = createStore(rootReducer, composeWithDevTools(applyMiddleware(thunk)))

function Index() {
    return (
        <Provider store={store}>
            <BrowserRouter>
                <Switch>
                    <Route path={'/'} exact component={LandingPageLayout}></Route>
                </Switch>
            </BrowserRouter>
        </Provider>
    )
}

export default App;
